import React from 'react';
import { Grid, Paper, Typography,con } from '@mui/material';

const sideNavStyle = {
    height: '100%',
};


const Home = () => {


    return (
        <Container maxWidth="xl" style={{ height: '100vh' }}>
        {/* Side Navigation */}
        <Box display="flex" flexDirection="column" style={{ height: '100%' }}>
            {/* First Part */}
            <Paper style={{ ...sideNavStyle, paddingLeft: '30px', paddingTop: '30px', paddingBottom: '30px', marginBottom: '20px' }}>
                <div style={{ padding: '10px' }}>
                    <Typography variant="h6">First Part</Typography>
                    {/* Add your first part content here */}
                </div>
            </Paper>

            {/* Second Part */}
            <Paper style={{ ...sideNavStyle, paddingLeft: '30px', paddingTop: '30px', paddingBottom: '30px' }}>
                <div style={{ padding: '10px' }}>
                    <Typography variant="h6">Second Part</Typography>
                    {/* Add your second part content here */}
                </div>
            </Paper>
        </Box>

        {/* Header and Main Screen */}
        <Box display="flex" flexDirection="column" style={{ height: '100%', paddingLeft: '30px', paddingTop: '30px', paddingBottom: '45px' }}>
            {/* Header */}
            <Paper style={{ ...sideNavStyle, marginBottom: '20px' }}>
                <Typography variant="h6">Header</Typography>
                {/* Add your header content here */}
            </Paper>

            {/* Main Screen */}
            <Paper style={{ ...sideNavStyle, flexGrow: 1 }}>
                <Typography variant="h6">Main Screen</Typography>
                {/* Add your main screen content here */}
            </Paper>
        </Box>
    </Container>
    );
};

export default Home;
